import styled from "styled-components";

const Item = styled.div`
    font-size: 1.5em;
    text-align: left;
    margin-top: 3%;
    border: 1px solid;
    border-radius: 5%;
    padding: 1%;
    width: 50%
`

function TodoItem(props) {
    return (
        <Item> Hey </Item>
    );
}

export default TodoItem;
